                     function UpdateText(textId, textValue) {

                            url: urlDescription,
                            type: "GET",
                            async:false, 
                            headers: { "Accept": "application/json;odata=verbose" },
                            success: function (data) {
                                
                                jQuery.each(data.d.results, function (index, value) {
                                    if(id == value.Title){
                                        description = value.popup;
                                    }                             
                                });
                            },
                            error: function (data) {
                                //output error 
                                console.log(data);
                            }
                        });
                        
                        return description;
                     }
